      <Greet name="Developer" heroName="Nemesis"/>
      <Welcome name="Bukenya" heroName="Kent"/>
      <Welcome name="Lukman" heroName="Batman"/>
      <Welcome name="Developer" heroName="Nemesis"/>
      {/* <Hello/> */}
    </div>
  );
}

